import React, { useContext } from 'react';
import { useQuery, useMutation } from '@apollo/react-hooks';
import { MY_PROFILE } from '../../graphql/Profile';
import { AuthContext } from '../../contexts/AuthProvider';
import dayjs from 'dayjs';
const Profile = () => {
    //onst { user } = useContext(AuthContext);
    const { data, loading, error } = useQuery(MY_PROFILE)

    if (error) return <p>Oooops...Something went wrong!</p>
    if (loading) return <p>Loading...!</p>

    //const birthdate = data.user.profile.birthdate;
    return (

        <>
            {data.user.profile === null ? <button>Create Profile</button> :
                <div>
                    <h1>Profile Detail</h1>
                    <div>
                        <img src={data.user.profile.profileImage} alt="profile_image"/>
                    </div>
                    <span>{}</span><br/>
                    <span>{data.user.profile.id}</span><br/>
                    <span>{data.user.profile.firstname}</span><br/>
                    <span>{data.user.profile.lastname}</span><br/>
                    <span>{dayjs(data.user.profile.birthdate).format('MMM DD YYYY')}</span><br/>
                    <span>{data.user.profile.age}</span><br/>
                    <span>{data.user.profile.mentalStatus}</span><br/>

                </div>}
        </>
    )
}

export default Profile;
